import React from 'react'
import { useEffect } from 'react'
import { useState } from 'react'
import axios from 'axios'
import { useLocation } from 'react-router-dom'
import { useNavigate } from "react-router-dom"
import { Link} from "react-router-dom"

const Dashboard = () => {
    const [booklist,setBook] = useState([])
    const location = useLocation();

    useEffect(() => {
        const fetchAll = async () => {
            try {
                const res = await axios.get("http://localhost:8800/booklist/"+location.state.id[0]["reader_id"])
                setBook(res.data)
                console.log(res)
            } catch(err) {
                console.log(err)
            }
        }
        fetchAll()
    }, [])

    const navigate = useNavigate()
    const fname = location.state.id[0]["reader_fname"];
    const lname = location.state.id[0]["reader_lname"];
    //console.log()

    const handleClick = async e =>{
        e.preventDefault()
        try{
            navigate("/search", {
                state: {
                    id: location.state.id
                }
            })
        }catch(err){
            console.log(err)
        }
    };

    return (
        <div>
            <h1>Welcome, {fname} {lname}</h1>
            <div className="books">
                <Link to='/login/'>
                <button onClick={handleClick}>Go to Search</button>
                </Link>
                <h4>Your Booklist</h4>
                {booklist.map((booklist) =>(
                    <div className="booklist" key={booklist.book_id}>
                        <h5>{booklist.book_title}</h5>
                        <img src={booklist.cover_img} alt="" /><h5>Your Rating: {booklist.reader_rating}</h5>
                    </div>
                ))}
            </div>
        </div>
    )
}

export default Dashboard
